      subtitleItem: 'Ультразвуковая система',
      itemDesc: "Современные технологии выводят портативные ультразвуковые системы на новый уровень качества изображений, поэтому можно не жертвовать качеством ради портативности. Система соответствует требованиям к отделениям интенсивной терапии и обладает производительностью стационарных систем там, где это необходимо.",
